query prisma_deeplyNested {
  Album(where: {ArtistId:{_eq: 127}}) {
    AlbumId
    Title
    tracks {
      TrackId
      Name
      genre {
        Name
      }
    }
    artist {
      albums {
        tracks {
          media {
            Name
          }
          genre {
            Name
          }
        }
      }
    }
  }
}
